import React from 'react';
import NavMenu from './NavMenu';
import '../Styles/General.css';

function Events(){
    return (
        <div className='page-setup'>
            <div className='page-content'>
                <h1 className='title'>EVENTS</h1>
                <hr />
                <br></br>
                <h2>WORKSHOT WITH SAMUEL BOLDUC</h2>
                <br></br>
                <p>
                Join photographer Samuel Bolduc for a presentation about his research and exploration techniques to push artistic boundaries. Drawing inspiration from surrealism, Bolduc is an expert at creating a new world through photography. This presentation is designed for photographers of all levels seeking fresh perspectives and creative growth.

                No equipment is required for this session.</p>
                <NavMenu />

            </div>

        </div>

    );
}

export default Events;
